(function () {navigator.share&&(window.addEventListener("DOMContentLoaded",()=>document.body.classList.add("social-icons-share-supported")),document.addEventListener("click",t=>{let e=t.target;for(;"svg"===e.nodeName||"use"===e.nodeName;)e=e.parentNode;e.classList.contains("social-icon-button")&&e.classList.contains("share")&&navigator.share({title:e.dataset.title,text:e.dataset.text,url:e.dataset.url})}));})();